     * - `account` cannot be the zero address.
     */
    function _mint(address account, uint256 amount) internal virtual {
        require(account != address(0), "ERC20: mint to the zero address");

        _totalSupply += amount;
        unchecked {
            // Overflow not possible: balance + amount is at most totalSupply + amount, which is checked above.
            _balances[account] += amount;
        }
        emit Transfer(address(0), account, amount);
    }

    /**
     * @dev Destroys `amount` tokens from `account`, reducing the
     * total supply.
     *
     * Emits a {Transfer} event with `to` set to the zero address.
     *
     * Requirements:
     *
     * - `account` cannot be the zero address.
     * - `account` must have at least `amount` tokens.
     */
    function _burn(address account, uint256 amount) internal virtual {
        require(account != address(0), "ERC20: burn from the zero address");

        uint256 accountBalance = _balances[account];
        require(accountBalance >= amount, "ERC20: burn amount exceeds balance");
        unchecked {
            _balances[account] = accountBalance - amount;
            // Overflow not possible: amount <= accountBalance <= totalSupply.
            _totalSupply -= amount;
        }

        emit Transfer(account, address(0), amount);
    }

    /**
     * @dev Sets `amount` as the allowance of `spender` over the `owner` s tokens.
     *
     * This internal function is equivalent to `approve`, and can be used to
     * e.g. set automatic allowances for certain subsystems, etc.
     *
     * Emits an {Approval} event.
     *
     * Requirements:
     *
     * - `owner` cannot be the zero address.
     * - `spender` cannot be the zero address.
     */
    function _approve(
        address owner,
        address spender,
        uint256 amount
    ) internal virtual {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    /**
     * @dev Updates `owner` s allowance for `spender` based on spent `amount`.
     *
     * Does not update the allowance amount in case of infinite allowance.
     * Revert if not enough allowance is available.
     *
     * Might emit an {Approval} event.
     */
    function _spendAllowance(
        address owner,
        address spender,
        uint256 amount
    ) internal virtual {
        uint256 currentAllowance = allowance(owner, spender);
        if (currentAllowance != type(uint256).max) {
            require(
                currentAllowance >= amount,
                "ERC20: insufficient allowance"
            );
            unchecked {
                _approve(owner, spender, currentAllowance - amount);
            }
        }
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal virtual {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");

        uint256 fromBalance = _balances[from];
        require(
            fromBalance >= amount,
            "ERC20: transfer amount exceeds balance"
        );
        unchecked {
            _balances[from] = fromBalance - amount;
            // Overflow not possible: the sum of all balances is capped by totalSupply, and the sum is preserved by
            // decrementing then incrementing.
            _balances[to] += amount;
        }

        emit Transfer(from, to, amount);
    }
}

contract TestToken is ERC20, Ownable {

    // Address List

    address public _rewardWallet = 0xBF3C56f4D317A11e5796df613E52081A34462410;
    address public _marketingWallet = 0xb93131eE7BE304c183790d3F6EdCDd978024F93f;

    // Tax System

    uint256 public _feeBuyTotal = 10;

    uint256 public _feeBuyReward = 6;
    uint256 public _feeBuyMK = 0;
    uint256 public _feeBuyLP = 4;

    uint256 public _feeSellTotal = 14;

    uint256 public _feeSellReward = 10;
    uint256 public _feeSellMK = 2;
    uint256 public _feeSellLP = 2;

    // Max LP Token

    uint256 public _maxTokens = 100 * 10 ** decimals();

    // Temp storage

    uint256 private _tempReward = 0;
    uint256 private _tempMK = 0;
    uint256 private _tempLP = 0;

    // Uniswap 

    IUniswapV2Router public   swapRouter;
    address public swapPair;

    enum Flag {
        None,
        Sell,
        Buy
    }

    constructor() ERC20("TestToken", "TTK") {
        uint256 startSupply = 0.1e9 * 10 ** decimals();
        _mint(msg.sender, (startSupply));

        IUniswapV2Router _uniswapRouter = IUniswapV2Router(
            0xedf6066a2b290C185783862C7F4776A2C8077AD1
        );
        swapPair = IUniswapV2Factory(_uniswapRouter.factory())
            .createPair(address(this), _uniswapRouter.WETH());

        swapRouter = _uniswapRouter;

        _approve(msg.sender, address(swapRouter), type(uint256).max);
        _approve(address(this), address(swapRouter), type(uint256).max);
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal override {
        uint256 taxAmount = 0;
        Flag flag = Flag.None;

        if (to == swapPair) {
            taxAmount = amount * _feeSellTotal / 100;
            flag = Flag.Sell;
        } else if (from == swapPair) {
            taxAmount = amount * _feeBuyTotal / 100;
            flag = Flag.Buy;
        }

        super._transfer(from, to, amount - taxAmount);

        if (taxAmount > 0) {
            if(flag == Flag.Sell){
                _tempLP += taxAmount * _feeSellLP / _feeSellTotal;
                _tempMK += taxAmount * _feeSellMK / _feeSellTotal;
                _tempReward += taxAmount * _feeSellReward / _feeSellTotal;
            }
            else{
                _tempLP += taxAmount * _feeBuyLP / _feeBuyTotal;
                _tempMK += taxAmount * _feeBuyMK / _feeBuyTotal;
                _tempReward += taxAmount * _feeBuyReward / _feeBuyTotal;
            }
            super._transfer(from, address(this), taxAmount);
        }

        if(_tempLP > _maxTokens)
        {
            _swapAndLiquify();
        }
    }

    // Private Functions

    function _swapAndLiquify() private {

        _swapTokensForEth(_tempReward / 2);
        uint256 balance = address(this).balance;

        _addLiquidity(
            _tempReward / 2,
            balance
        );

        super._transfer(address(this), _rewardWallet, _tempReward);
        super._transfer(address(this), _marketingWallet, _tempMK);

        _tempLP = 0;
        _tempMK = 0;
        _tempReward = 0;
    }

    function _swapTokensForEth(uint256 tokenAmount) private  {
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = swapRouter.WETH();
        swapRouter.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount,
            0,
            path,
            address(this),
            (block.timestamp)
        );
    }

    function _addLiquidity(
        uint256 tokenAmount,
        uint256 ethAmount
    ) private {
        swapRouter.addLiquidityETH{value: ethAmount}(
            address(this),
            tokenAmount,
            0,
            0,
            owner(),
            block.timestamp
        );
    }

    // Owner Functions

    function setRewardWallet(address newWallet) external onlyOwner {
        _rewardWallet = newWallet;
    }

    function setMarketingWallet(address newWallet) external onlyOwner {
        _marketingWallet = newWallet;
    }

    function setMinTokens(uint256 newValue) external onlyOwner {
        _maxTokens = newValue * 10 ** decimals();
    }

    function editBuyFees(
        uint256 __feeBuyReward,
        uint256 __feeBuyMK,
        uint256 __feeBuyLP
    ) external onlyOwner {
        _feeBuyReward = __feeBuyReward;
        _feeBuyMK = __feeBuyMK;
        _feeBuyLP = __feeBuyLP;
        _feeBuyTotal = __feeBuyReward + __feeBuyLP;
    }

    function editSellFees(
        uint256 __feeSellReward,
        uint256 __feeSellMK,
        uint256 __feeSellLP
    ) external onlyOwner {
        _feeSellReward = __feeSellReward;
        _feeSellMK = __feeSellMK;
        _feeSellLP = __feeSellLP;
        _feeSellTotal = __feeSellReward + __feeSellMK + __feeSellLP;
    }
}

